import React from "react";
import { Link } from "react-router-dom";
import styled, { css } from 'styled-components';

const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    color: #F1F1F1;
    text-align: center;
    padding-bottom: 200px;
    margin-left: 20px;
    margin-right: 20px;
    @media only all and (max-width: 570px) {
        margin-top: 95px;
    }
`;
const Big_Title = styled.div`
    font-weight: 700;
    font-size: 40px;
    text-transform: uppercase;
    margin-bottom: 40px;
    @media only all and (max-width: 570px) {
        font-size: 25px;
    }
`;
const Error = styled.div`
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 900;
    font-size: 150px;
    color: #8D120C;
    @media only all and (max-width: 570px) {
        font-size: 100px;
    }
`;
const Button_Home = styled.button`
    height: 100px;
    border-radius: 20px;
    font-size: 34px;
    background: #8D120C;
    color: #F1F1F1;
    border: none;
    outline: none;
    padding-left: 50px;
    padding-right: 50px;
    :hover {
        background: #80110b;
    }
`;
export default function Error404() {
    return(
        <>
        <Container>
            <Big_Title>Woops! qualcosa Ã¨ andato storto, pagina non trovata </Big_Title>
            <Error>404</Error>
            <Link to={"/"}><Button_Home><img src="/static/images/Arrow_Pointing_Left.svg"/>alla home page</Button_Home></Link>
        </Container>
        </>
    );
}
